import './App.css';
let name = "Zaidi";
function App() {
  return (
    <>
    <nav>
      <h1>Hello {name}</h1>
      <li>Home</li>
      <li>About</li>
      <li>Contact</li>
    </nav>
    <div className="container">
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Illum, dolorum.</p>
    </div>
    </>

  );
}

export default App;
